let k='key',l=localStorage,p=l.getItem(k),s=document.createElement('script');if(!p){p=prompt('输入密钥');l.setItem(k,p);}s.type='module';s.textContent=CryptoJS.AES.decrypt('',p).toString(CryptoJS.enc.Utf8);document.getElementById('script').nextElementSibling.after(s);window.addEventListener('message',({data})=>{if((data).startsWith('pwd'))l.setItem('key',data.substring(3))})